const OurServiceItem = ({ image, title, desc }) => {

  return (
    <div class="service__card">
      <div class="service__card__box">
        <div class="service__card__img">
          <img class="service__card__img__el" src={image} alt={title} />
        </div>
        <div class="service__card__txt">
          <h3 class="service__card__title">{title}</h3>
          <p class="service__card__desc">{desc}</p>
        </div>
      </div>
    </div>
  )
}

export default OurServiceItem;
